const useFilterPlanets = (input, { results }) => {

  if (results !== undefined) {
    console.log(input);
    const planet = () => {
      return results.includes(input);
    };
    const test = results.filter((result) => result.name.includes(input));
    console.log(test);
  }
};

export default useFilterPlanets;
